import React, { useRef,useEffect} from 'react'
import { useGLTF } from '@react-three/drei'
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls'//added by me
import {useFrame,extend,useThree} from '@react-three/fiber'//added by me and above in 1st line also useeffect added by me

//from here to till added by me.

extend({OrbitControls});

const Controls = () => {
  const orbitRef = useRef();
  const { camera, gl } = useThree();

  useFrame(() => {
    orbitRef.current.update();
  });

  return (
    <orbitControls
      ref={orbitRef}
      args={[camera, gl.domElement]}
      autoRotate
      enableDamping
      dampingFactor={0.1}
      rotateSpeed={2.5}//before it was 0.7 speed was
    />
  );
};


let camera, scene, renderer;
let cameraSpeed = 0.2;
let zoomSpeed = 0.1;
let isDragging = false;
let previousMousePosition = {
    x: 0,
    y: 0
};

init();
animate();

function init() {
    camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 1, 1000);
    camera.position.z = 5;

    scene = new THREE.Scene();

    // Assuming you've added your room and apartment objects to the scene already

    renderer = new THREE.WebGLRenderer();
    renderer.setSize(window.innerWidth, window.innerHeight);
    document.body.appendChild(renderer.domElement);

    document.addEventListener('keydown', onDocumentKeyDown, false);
    document.addEventListener('wheel', onDocumentMouseWheel, false);
    document.addEventListener('mousedown', onMouseDown, false);
    document.addEventListener('mousemove', onMouseMove, false);
    document.addEventListener('mouseup', onMouseUp, false);
    window.addEventListener('resize', onWindowResize, false);
}

function onWindowResize() {
    camera.aspect = window.innerWidth / window.innerHeight;
    camera.updateProjectionMatrix();
    renderer.setSize(window.innerWidth, window.innerHeight);
}

function onDocumentKeyDown(event) {
    var keyCode = event.which;
    if (keyCode == 87) {
        camera.position.z -= cameraSpeed; // W key
    } else if (keyCode == 83) {
        camera.position.z += cameraSpeed; // S key
    } else if (keyCode == 65) {
        camera.position.x -= cameraSpeed; // A key
    } else if (keyCode == 68) {
        camera.position.x += cameraSpeed; // D key
    } else if (keyCode == 187) { // '+' key
        camera.fov -= zoomSpeed;
    } else if (keyCode == 189) { // '-' key
        camera.fov += zoomSpeed;
    }
    camera.updateProjectionMatrix();
}

function onDocumentMouseWheel(event) {
    camera.fov += event.deltaY * 0.05;
    camera.updateProjectionMatrix();
}

function onMouseDown(event) {
    isDragging = true;
    previousMousePosition = {
        x: event.clientX,
        y: event.clientY
    };
}

function onMouseMove(event) {
    if (isDragging) {
        const deltaMove = {
            x: event.clientX - previousMousePosition.x,
            y: event.clientY - previousMousePosition.y
        };

        camera.position.x -= deltaMove.x * 0.01;
        camera.position.y += deltaMove.y * 0.01;

        previousMousePosition = {
            x: event.clientX,
            y: event.clientY
        };
    }
}

function onMouseUp(event) {
    isDragging = false;
}

function animate() {
    requestAnimationFrame(animate);
    renderer.render(scene, camera);
}


